// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;
import  {PriceConverter} from "./PriceConverter.sol";
contract FundMe {
    using PriceConverter for uint256;
    uint256 public  constant MIN_USD= 5e18;
    address[] public funders;
    mapping(address=>uint256) public addressAmountfunded;
    address public immutable i_owner;
    constructor(){
      i_owner=msg.sender;
    }
    function withdraw() public onlyOwner{
        for(uint256 i=0;i<funders.length;i++){
            address funder=funders[i];
            addressAmountfunded[funder]=0;
        }
        funders=new address[](0);
      (bool callsuccess,)=payable (msg.sender).call{value:address(this).balance}("");
      require(callsuccess,"failed");
    }    

    function fund() public payable {
        require( msg.value.getconversionrate()>= MIN_USD , "Too small");
        funders.push(msg.sender);
        addressAmountfunded[msg.sender]+= msg.value;
    }

  modifier onlyOwner(){
    require(msg.sender==i_owner,"You are not owner");
    _;
  }
    receive() external payable {
      fund();
     }
     fallback() external payable {
      fund();
      }


}

Section3/PriceConverter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;
import {AggregatorV3Interface} from "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

library PriceConverter{
     function getLatestPrice() internal  view returns (uint256) {
      AggregatorV3Interface priceFeed =
        AggregatorV3Interface(0x1b44F3514812d835EB1BDB0acB33d3fA3351Ee43);
        (,int256 answer, , , ) = priceFeed.latestRoundData();
        return uint(answer)*1e10;

    }

    function getVersion() internal  view returns (uint256) {
        return
            AggregatorV3Interface(0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419)
                .version();
    }

    function getconversionrate(uint256 ethamt) internal  view  returns (uint256) {
        uint256 ethprice=getLatestPrice();//2000e18
        uint256 ethinUSD = (ethamt*ethprice)/1e18; //id ethamt 1 then eth in usd is 2000e18
       return ethinUSD;
    }
}

